import React from 'react'

import './css/Header.css'

const Header = (props) => {

  return (
    <div className='nav'>
        <h1>Spotipy</h1>
        <textarea onChange={(e) => props.changePlaylistLink(e.target.value)} value = {props.playlistLink}></textarea>
        <button onClick={props.getPlaylistStats}>Get Stats</button>
    </div>
  )

}

export default Header
